import React from 'react';
import { BrowserRouter as Router, Route } from "react-router-dom";
import './App.css';
import StartPage from './start-page/startPage';


const App = () => {


  return (
    <Router>
        <Route exact path="/" component={StartPage} />
    </Router>
  );
}

export default App;
